        \   </var>\n    <var ID=\"SERIAL\" dcml=\"0\" files=\"ExtractData\" intrvl=\"contin\"
        name=\"SERIAL\">\n      <location EndPos=\"18\" StartPos=\"11\" width=\"8\"/>\n
        \     <labl>Household serial number</labl>\n      <txt><![CDATA[SERIAL is
        an identifying number unique to each household record in a given sample. All
        person records are assigned the same serial number as the household record
        that they follow. (Person records also have their own unique identifiers -
        see PERNUM.) A combination of SAMPLE and SERIAL provides a unique identifier
        for every household in the IPUMS; the combination of SAMPLE, SERIAL, and PERNUM
        uniquely identifies every person in the database.\n\nFor 1850-1930, households
        that are part of a multi-household dwelling can be identified by using the
        DWELLING and DWSEQ variables. See \"Sample Designs\" for further discussion
        of sampling from within multi-household dwellings.]]></txt>\n      <codInstr><![CDATA[CodesSERIAL
        is an 8-digit numeric variable which assigns a unique identification number
        to each household record in a given sample (See PERNUM for the analogous person
        record identifier). A combination of SAMPLE and SERIAL provides a unique identifier
        for every household in the IPUMS; the combination of SAMPLE, SERIAL, and PERNUM
        uniquely identifies every person in the database. SERIAL specific variable
        codes for missing, edited, or unidentified observations, observations not
        applicable (N/A), observations not in universe (NIU), top and bottom value
        coding, etc. are provided below if applicable by Census year (and data sample
        if specified).\n\nSERIAL Specific Variable Codes]]></codInstr>\n      <concept
        vocab=\"IPUMS\">Technical Variables -- HOUSEHOLD</concept>\n      <varFormat
        schema=\"other\" type=\"numeric\"/>\n    </var>\n    <var ID=\"CBSERIAL\"
        dcml=\"0\" files=\"ExtractData\" intrvl=\"contin\" name=\"CBSERIAL\">\n      <location
        EndPos=\"31\" StartPos=\"19\" width=\"13\"/>\n      <labl>Original Census
        Bureau household serial number</labl>\n      <txt><![CDATA[CBSERIAL is the
        unique, original identification number assigned to each household record in
        a given sample by the Census Bureau. All person records are assigned the same
        serial number as the household record that they follow. (The original person
        record unique identification numbers assigned by the Census Bureau are provided
        by CBPERNUM.) \n\nA combination of SAMPLE and CBSERIAL provides a unique identifier
        for every household in the IPUMS; the combination of SAMPLE, CBSERIAL, and
        CBPERNUM uniquely identifies every person in the database.]]></txt>\n      <codInstr><![CDATA[CodesCBSERIAL
        is an 8-digit numeric variable which assigns a unique identification number
        to each household record in a given sample (See CBPERNUM for the analogous
        person record identifier). CBSERIAL specific variable codes for missing, edited,
        or unidentified observations, observations not applicable (N/A), observations
        not in universe (NIU), top and bottom value coding, etc. are provided below
        if applicable by Census year (and data sample if specified).\n\nCBSERIAL Specific
        Variable Codes]]></codInstr>\n      <concept vocab=\"IPUMS\">Technical Variables
        -- HOUSEHOLD</concept>\n      <varFormat schema=\"other\" type=\"numeric\"/>\n
        \   </var>\n    <var ID=\"HHWT\" dcml=\"2\" files=\"ExtractData\" intrvl=\"contin\"
        name=\"HHWT\">\n      <location EndPos=\"41\" StartPos=\"32\" width=\"10\"/>\n
        \     <labl>Household weight</labl>\n      <txt><![CDATA[HHWT indicates how
        many households in the U.S. population are represented by a given household
        in an IPUMS sample. \n\nIt is generally a good idea to use HHWT when conducting
        a household-level analysis of any IPUMS sample. The use of HHWT is optional
        when analyzing one of the \"flat\" or unweighted IPUMS samples. Flat IPUMS
        samples include the 1% samples from 1850-1930, all samples from 1960, 1970,
        and 1980, the 1% unweighted samples from 1990 and 2000, the 10% 2010 sample,
        and any of the full count 100% census datasets. HHWT must be used to obtain
        nationally representative statistics for household-level analyses of any sample
        other than those.\n\nUsers should also be sure to select one person (e.g.,
        PERNUM = 1) to represent the entire household.\n\nFor further explanation
        of the sample weights, see \"Sample Designs\" and \"Sample Weights\". See
        also PERWT for a corresponding variable at the person level, and SLWT for
        a weight variable used with sample-line records in 1940 1% and 1950.]]></txt>\n
        \     <codInstr><![CDATA[CodesHHWT is a 6-digit numeric variable which indicates
        how many households in the U.S. population are represented by a given household
        in an IPUMS sample and has two implied decimals. For example, a HHWT value
        of 010461 should be interpreted as 104.61. HHWT specific variable codes for
        missing, edited, or unidentified observations, observations not applicable
        (N/A), observations not in universe (NIU), top and bottom value coding, etc.
        are provided below if applicable by Census year (and data sample if specified).\n\nUser
        Note: Users should also be sure to select one person (e.g., PERNUM = 1) to
        represent the entire household when using HHWT.\n\nHHWT Specific Variable
        Codes]]></codInstr>\n      <concept vocab=\"IPUMS\">Technical Variables --
        HOUSEHOLD</concept>\n      <varFormat schema=\"other\" type=\"numeric\"/>\n
        \   </var>\n    <var ID=\"GQ\" dcml=\"0\" files=\"ExtractData\" intrvl=\"discrete\"
        name=\"GQ\">\n      <location EndPos=\"42\" StartPos=\"42\" width=\"1\"/>\n
        \     <labl>Group quarters status</labl>\n      <txt><![CDATA[GQ classifies
        all housing units as falling into one of three main categories: households,
        group quarters, or vacant units. It also identifies fragmentary sample units
        for 1850-1930 (see below). In all years, the data available about a person
        and their co-residents depend on whether the person lives in a household or
        in group quarters. Households are sampled as units, meaning that everyone
        in the household is included in the sample, and most household-level variables
        are available. People living in group quarters are generally sampled as individuals;
        other people in their unit may or may not be included in the sample, and there
        is no way of linking co-residents' records to one another. If, however, a
        sampled person in group quarters was living with relatives, the related group
        was sampled for 1850-1930. Most household-level variables are not available
        for group quarters or for vacant units.\n\nGroup quarters are largely institutions
        and other group living arrangements, such as rooming houses and military barracks.
        The definitions vary from year to year, but the pre-1940 samples have generally
        used a definition of group quarters that includes units with 10 or more individuals
        unrelated to the householder. See the comparability discussion below and \"Sample
        Designs\" for more details about changing definitions of group quarters.  Group-quarters
        types are identified in further detail by GQTYPE and GQFUNDS.]]></txt>\n      <catgry>\n
        \       <catValu>0</catValu>\n        <labl>Vacant unit</labl>\n      </catgry>\n
        \     <catgry>\n        <catValu>1</catValu>\n        <labl>Households under
        1970 definition</labl>\n      </catgry>\n      <catgry>\n        <catValu>2</catValu>\n
        \       <labl>Additional households under 1990 definition</labl>\n      </catgry>\n
        \     <catgry>\n        <catValu>3</catValu>\n        <labl>Group quarters--Institutions</labl>\n
        \     </catgry>\n      <catgry>\n        <catValu>4</catValu>\n        <labl>Other
