        \     <labl>Person number in sample unit</labl>\n      <txt><![CDATA[PERNUM
        numbers all persons within each household consecutively in the order in which
        they appear on the original census or survey form. When combined with SAMPLE
        and SERIAL, PERNUM uniquely identifies each person within the IPUMS.]]></txt>\n
        \     <codInstr><![CDATA[CodesPERNUM is a 4-digit numeric variable which numbers
        all persons within each household consecutively in the order in which they
        appear on the original census or survey form. PERNUM specific variable codes
        for missing, edited, or unidentified observations, observations not applicable
        (N/A), observations not in universe (NIU), top and bottom value coding, etc.
        are provided below if applicable by Census year (and data sample if specified).]]></codInstr>\n
        \     <concept vocab=\"IPUMS\">Technical Variables -- PERSON</concept>\n      <varFormat
        schema=\"other\" type=\"numeric\"/>\n    </var>\n    <var ID=\"PERWT\" dcml=\"2\"
        files=\"ExtractData\" intrvl=\"contin\" name=\"PERWT\">\n      <location EndPos=\"56\"
        StartPos=\"47\" width=\"10\"/>\n      <labl>Person weight</labl>\n      <txt><![CDATA[PERWT
        indicates how many persons in the U.S. population are represented by a given
        person in an IPUMS sample. \n\nIt is generally a good idea to use PERWT when
        conducting a person-level analysis of any IPUMS sample. The use of PERWT is
        optional when analyzing one of the \"flat\" or unweighted IPUMS samples. Flat
        IPUMS samples include the 1% samples from 1850-1930, all samples from 1960,
        1970, and 1980, the 1% unweighted samples from 1990 and 2000, the 10% 2010
        sample, and any of the full count 100% census datasets. PERWT must be used
        to obtain nationally representative statistics for person-level analyses of
        any sample other than those.\n\nFor further explanation of the sample weights,
        see \"Sample Designs\" and \"Sample Weights\". See also HHWT for a corresponding
        variable at the household level, and SLWT for a weight variable used with
        sample-line records in 1940 and 1950.]]></txt>\n      <codInstr><![CDATA[CodesPERWT
        is a 6-digit numeric variable which indicates how many persons in the U.S.
        population are represented by a given person in an IPUMS sample and has two
        implied decimals. For example, a PERWT value of 010461 should be interpreted
        as 104.61. PERWT specific variable codes for missing, edited, or unidentified
        observations, observations not applicable (N/A), observations not in universe
        (NIU), top and bottom value coding, etc. are provided below if applicable
        by Census year (and data sample if specified).\n\nPERWT Specific Variable
        Codes]]></codInstr>\n      <concept vocab=\"IPUMS\">Technical Variables --
        PERSON</concept>\n      <varFormat schema=\"other\" type=\"numeric\"/>\n    </var>\n
